export default (function(a,b,c,d,e,f,g,h,i,j,k,l,m){return {data:{lyIU15lw0y:{data:{id:1558,attributes:{imdbId:"tt0034881",poster:"https:\u002F\u002Fm.media-amazon.com\u002Fimages\u002FM\u002FMV5BMjE3ZGU1MTUtZWEyMi00YjYzLWE4Y2QtNDUzYzRhMDZiOGYzXkEyXkFqcGdeQXVyNjc0MzMzNjA@._V1_SX300.jpg",type:"movie",ratings:[{Source:"Internet Movie Database",Value:"7.1\u002F10"},{Source:"Rotten Tomatoes",Value:"95%"}],item_lang:{data:{id:2221,attributes:{title:"I Married a Witch",plot:"In 1672, two witches (Jennifer and her father Daniel) were burned by puritan Jonathan Wooley. In revenge, Jennifer cursed all future generations of the Wooley family, that the sons will always marry the wrong woman and be miserable. In the 20th century, a bolt of lightning frees Jennifer and her father from the tree that had kept their souls imprisoned. Jennifer assumes corporeal form and decides to make up-and-coming politician Wallace Wooley, then unhappily engaged, even more miserable by getting him to fall in love with her before his wedding. Wallace is a straight arrow, though, and Jennifer has to resort to a love potion. As we all know, love potions tend to backfire, with comedic results.",slug:"i-married-a-witch"}}},books:{data:[{id:8165,attributes:{title:d,description:e,thumbnail:f,authors:[b],firstBook:true,published:g,publisher:h,subtitle:a}},{id:8166,attributes:{title:d,description:e,thumbnail:f,authors:[b],firstBook:c,published:g,publisher:h,subtitle:a}},{id:8167,attributes:{title:i,description:j,thumbnail:k,authors:[b],firstBook:c,published:l,publisher:m,subtitle:a}},{id:8168,attributes:{title:i,description:j,thumbnail:k,authors:[b],firstBook:c,published:l,publisher:m,subtitle:a}},{id:8169,attributes:{title:"The passionate witch",description:a,thumbnail:a,authors:[b,"Norman Matson"],firstBook:c,published:"1955-01-01",publisher:a,subtitle:a}}]}}},meta:{}}},prerenderedAt:1680940971568}}("","Thorne Smith",null,"The Passionate Witch","A self-important tycoon meets his future wife when he rescues her from a hotel fire. He begins to question the wisdom of their union when he sees his new bride climbing down the trumpet vine outside their bedroom window, riding the goat through the apple orchard in the moonlight, and killing chickens. Among other things. (Includes original illustrations) (Includes original illustrations)","https:\u002F\u002Fbooks.google.com\u002Fbooks\u002Fcontent?id=jj56AgAAQBAJ&printsec=frontcover&img=1&zoom=5&edge=curl&source=gbs_api","1961-01-01","eNet Press","The Passionate Witch (Horror and Fantasy Classics)","This early work by Thorne Smith was originally published in 1942 and we are now republishing it with a brand new introductory biography. 'The Passionate Witch' was James Thorne Smith Jr.'s last novel and was left unfinished at the time of his death in 1934, it was finally finished by Norman Matson. Mr. T. Wallace Wooly is a rich, sober, upstanding member of the community who lives a calm, frugal life after the death of his wife. This comfortable existence is ruined by a meeting with Jennifer Broome, Wooly is spellbound to the mysterious women with \" a great glory of lustrous dark hair....and a mouth curved in a short cat like smile\" and gravity defying cloths. What follows is a whirlwind romance, a string of disastrous 'accidents' and the uttering of a fateful curse.","https:\u002F\u002Fbooks.google.com\u002Fbooks\u002Fcontent?id=eFF-CgAAQBAJ&printsec=frontcover&img=1&zoom=5&edge=curl&source=gbs_api","2014-04-10","Read Books Ltd"))